CREATE DATABASE kg_movie;
USE kg_movie;
CREATE TABLE war_info(
   war_id                INTEGER  NOT NULL  
  ,win_country_name      text 
  ,defeated_country_name TEXT 
  ,start_year_date       TEXT 
  ,end_year_date         TEXT 
  ,location_name         TEXT
  ,death_number          TEXT 
  ,war_name              TEXT 
);
ALTER TABLE war_info CONVERT TO CHARACTER SET utf16 COLLATE utf16_general_ci;



alter table war_info drop column war_id;
alter table war_info add war_id INT UNSIGNED NOT NULL primary key auto_increment  first;
Create table country(
SELECT war_info.win_country_name FROM war_info
UNION
SELECT war_info.defeated_country_name FROM war_info);
alter table country change win_country_name country_name text;

alter table country add country_id INT UNSIGNED NOT NULL primary key auto_increment  first;
create table war(SELECT war_id, war_name, death_number from war_info);
Create table year(
SELECT war_info.start_year_date FROM war_info
UNION
SELECT war_info.end_year_date FROM war_info);
alter table year change start_year_date date text;

alter table year add year_id INT UNSIGNED NOT NULL primary key auto_increment  first;
Create table location(SELECT distinct war_info.location_name  from war_info);
alter table location add location_id INT UNSIGNED NOT NULL primary key auto_increment  first;

create table win (SELECT country_id,war_id from country inner join war_info on country.country_name=war_info.win_country_name);
alter table win add win_id INT UNSIGNED NOT NULL primary key auto_increment  first;
create table defeated (SELECT country_id,war_id from country inner join war_info on country.country_name=war_info.defeated_country_name);
alter table defeated add defeated_id INT UNSIGNED NOT NULL primary key auto_increment  first;







create table start (SELECT war_id ,year_id from year inner join war_info on year.date=war_info.start_year_date);
alter table start add start_id INT UNSIGNED NOT NULL primary key auto_increment  first;
create table end (SELECT war_id ,year_id from year inner join war_info on year.date=war_info.end_year_date);
alter table end add end_id INT UNSIGNED NOT NULL primary key auto_increment  first;

create table where_to_combat (SELECT war_id ,location_id from location inner join war_info on location.location_name=war_info.location_name);
alter table where_to_combat add where_to_combat_id INT UNSIGNED NOT NULL primary key auto_increment  first;